        <div className="card" style={{margin: '0px'}}>
            <div className="card-header">
                {nome}
                <div className="spinner-grow text-success" role="status" style={{height: '10px', width: '10px'}}>
                    <span className="visually-hidden">Loading...</span>
                </div>
            </div>
